import React from 'react'

function AppHeaderBottom() {
    return (
        <div className="header-bottom header-has-center header-has-not-center-sm main-menu-wrap" style={{top: '0px'}}><div className="header-row container"><div className="header-col header-center hidden-for-sm"><div id="mega-menu-wrap-main_menu" className="mega-menu-wrap"><div className="mega-menu-toggle"><div className="mega-toggle-blocks-left"><div className="mega-toggle-block mega-menu-toggle-custom-block mega-toggle-block-1 mega-menu-toggle-animated-block" id="mega-toggle-block-1"><span className="mega-toggle-label" role="button" aria-expanded="false"><span className="mega-toggle-label-closed"><img src="https://fiber.3bb.co.th/wp-content/uploads/2021/01/Hamburger_icon.svg_.png" /></span><span className="mega-toggle-label-open"><img src="https://fiber.3bb.co.th/wp-content/uploads/2021/01/bdd06f6420ca83e38227c5179fd3b261.png" /></span></span></div></div><div className="mega-toggle-blocks-center"><div className="mega-toggle-block mega-logo-block mega-toggle-block-2" id="mega-toggle-block-2"><a className="mega-menu-logo" href="https://fiber.3bb.co.th" target="_self"><img className="mega-menu-logo" src="https://fiber.3bb.co.th/wp-content/uploads/2021/01/3BB_logo_popup-1-300x128-1.png" /></a></div></div><div className="mega-toggle-blocks-right"><div className="mega-toggle-block mega-html-block mega-toggle-block-3" id="mega-toggle-block-3" /></div></div><ul id="mega-menu-main_menu" className="mega-menu max-mega-menu mega-menu-horizontal" data-event="click" data-effect="fade_up" data-effect-speed={200} data-effect-mobile="disabled" data-effect-speed-mobile={0} data-panel-width="#header" data-mobile-force-width="false" data-second-click="go" data-document-click="collapse" data-vertical-behaviour="standard" data-breakpoint={768} data-unbind="true" data-mobile-state="collapse_all" data-hover-intent-timeout={300} data-hover-intent-interval={100}><li className="mega-menu-item mega-menu-item-type-post_type mega-menu-item-object-page mega-menu-item-home mega-current-menu-item mega-page_item mega-page-item-32 mega-current_page_item mega-align-bottom-left mega-menu-flyout mega-has-icon mega-icon-left mega-menu-item-1640" id="mega-menu-item-1640"><a className="mega-custom-icon mega-menu-link" href="https://fiber.3bb.co.th/" tabIndex={0}>หน้าแรก</a></li><li className="mega-menu-item mega-menu-item-type-post_type mega-menu-item-object-page mega-align-bottom-left mega-menu-flyout mega-has-icon mega-icon-left mega-menu-item-1641" id="mega-menu-item-1641"><a className="mega-custom-icon mega-menu-link" href="https://fiber.3bb.co.th/3bb-giga-fiber/" tabIndex={0}>แพ็กเกจอินเทอร์เน็ต</a></li><li className="mega-menu-item mega-menu-item-type-custom mega-menu-item-object-custom mega-align-bottom-left mega-menu-flyout mega-has-icon mega-icon-left mega-menu-item-3951" id="mega-menu-item-3951"><a className="mega-custom-icon mega-menu-link" href="https://gigatv.3bb.co.th" tabIndex={0}>ทีวีและความบันเทิง</a></li><li className="mega-menu-item mega-menu-item-type-post_type mega-menu-item-object-page mega-align-bottom-left mega-menu-flyout mega-has-icon mega-icon-left mega-menu-item-1643" id="mega-menu-item-1643"><a className="mega-custom-icon mega-menu-link" href="https://fiber.3bb.co.th/promotion/" tabIndex={0}>โปรโมชั่น</a></li><li className="mega-menu-item mega-menu-item-type-custom mega-menu-item-object-custom mega-align-bottom-left mega-menu-flyout mega-has-icon mega-icon-left mega-menu-item-1646" id="mega-menu-item-1646"><a className="mega-custom-icon mega-menu-link" href="https://www.3bbprivilege.com/" tabIndex={0}>พอยต์และสิทธิพิเศษ</a></li><li className="mega-menu-item mega-menu-item-type-post_type mega-menu-item-object-page mega-align-bottom-left mega-menu-flyout mega-has-icon mega-icon-left mega-menu-item-1647" id="mega-menu-item-1647"><a className="mega-custom-icon mega-menu-link" href="https://fiber.3bb.co.th/shop/" tabIndex={0}>ศูนย์บริการ</a></li></ul></div></div></div></div>
    )
}

export default AppHeaderBottom
